'use strict';(function(){const indexCfg={encode:false,tokenize:function(str){const chineseRegex=/\W/;let words=str.split(/\s/);return words.flatMap(word=>{if(chineseRegex.test(word)){return word.split('');}else{return[word];}});}};indexCfg.doc={id:'id',field:['title','content'],store:['title','href'],};const index=FlexSearch.create('balance',indexCfg);window.bookSearchIndex=index;index.add({'id':0,'href':'/notes/docs/tools/api/','title':"API",'content':"seafile  上传文件：https://download.seafile.com/published/web-api/v2.1/file-upload.md  目录  seafile   "});index.add({'id':1,'href':'/notes/docs/program/bash/','title':"Bash",'content':"颜色[1] 表 1: 终端颜色转义码列表    颜色 转义码    正常 \\e[0m  红色 \\e[31m  绿色 \\e[32m     状态码[2] 表 2: 状态码    状态码 含义    1 其他错误  2 使用 shell 内建命令出错  126 命令无法执行  127 命令未找到  128 无效的参数  130 取消     备忘单 https://devhints.io/bash。\n参考文献 [1] FLOZZ. Bash tips: Colors and formatting (ANSI/VT100 Control sequences)[EB/OL]([日期不详]). https://misc.flogisoft.com/bash/tip_colors_and_formatting.\n [2] ORNBO G. Linux and Unix exit code tutorial with examples[EB/OL](2019–11–16). https://shapeshed.com/unix-exit-codes/.\n  目录  颜色[1] 状态码[2] 备忘单 参考文献   "});index.add({'id':2,'href':'/notes/categories/','title':"Categories",'content':""});index.add({'id':3,'href':'/notes/docs/program/css/','title':"CSS",'content':"对齐 # 靠右对齐 text-align: right; width[1]  默认值：auto  参考文献 [1] W3SCHOOLS. CSS width Property[EB/OL]([日期不详]). https://www.w3schools.com/cssref/pr_dim_width.asp.\n  目录  对齐 width[1] 参考文献   "});index.add({'id':4,'href':'/notes/docs/','title':"Docs",'content':""});index.add({'id':5,'href':'/notes/docs/program/golang/','title':"Golang",'content':"time 时间格式  2006-01-02 15:04:05 -0700  目录  time  时间格式    "});index.add({'id':6,'href':'/notes/docs/program/html/','title':"HTML",'content':"Language Code[1] 表 1: ISO 639-1 Language Codes    Language ISO Code    Chinese (Simplified) zh-Hans     参考文献 [1] W3SCHOOLS. HTML Language Code Reference[EB/OL]([日期不详]). https://www.w3schools.com/tags/ref_language_codes.asp.\n  目录  Language Code[1] 参考文献   "});index.add({'id':7,'href':'/notes/docs/program/js/','title':"JavaScript",'content':"Array flatMap[1] 等价于先 map() 再 flat()。\nlet arr1 = [1, 2, 3, 4];  arr1.map(x =\u0026gt; [x * 2]);  // [[2], [4], [6], [8]]  arr1.flatMap(x =\u0026gt; [x * 2]); // [2, 4, 6, 8]  // only one level is flattened arr1.flatMap(x =\u0026gt; [[x * 2]]); // [[2], [4], [6], [8]] 正则表达式  表 1: JavaScript 常用正则表达式    代码 含义    \\s 单个空白字符，等价于 [ \\f\\n\\r\\t\\v\\u00a0\\u1680\\u2000-\\u200a\\u2028\\u2029\\u202f\\u205f\\u3000\\ufeff]  \\W 非基本拉丁字母，等价于 [^A-Za-z0-9_]     导航到新地址[2] window.location.href = \u0026#39;...\u0026#39;; 得到链接的 href 属性[3] document.getElementById(\u0026quot;aaa\u0026quot;).href; 移动元素[4] newParent.appendChild(element); 参考文献 [1] MDN. Array.prototype.flatMap()[EB/OL]([日期不详]). https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Global_Objects/Array/flatMap.\n [2] STACKOVERFLOW. How to get the browser to navigate to URL in JavaScript [duplicate][EB/OL](2009–08–04). https://stackoverflow.com/a/1226718.\n [3] STACKOVERFLOW. Get local href value from anchor (a) tag[EB/OL](2013–03–15). https://stackoverflow.com/a/15439946.\n [4] STACKOVERFLOW. How to move all HTML element children to another parent using JavaScript?[EB/OL](2014–01–03). https://stackoverflow.com/questions/20910147/how-to-move-all-html-element-children-to-another-parent-using-javascript.\n  目录  Array  flatMap[1]  正则表达式 导航到新地址[2] 得到链接的 href 属性[3] 移动元素[4] 参考文献   "});index.add({'id':8,'href':'/notes/docs/tools/linux/','title':"Linux",'content':"手册 tldr # 安装 sudo pacman -S tldr rsync 带进度条的复制 rsync --info=progress2 -rh ${source} ${dest} 指定私钥文件[1] rsync -Pav -e \u0026quot;ssh -i $HOME/.ssh/somekey\u0026quot; username@hostname:/from/dir/ /to/dir/ 查找字符串 ripgrep # 在 python 文件里搜索 rg -tpy foo grep[2] grep -rl \u0026quot;string\u0026quot; /path 网络 curl 上传时显示进度条[3] curl ... | tee /dev/null urlencode 参数[4] curl ... --data-urlencode \u0026quot;paramName=value\u0026quot; 终端 tmux # 列出会话 tmux ls  # 创建新会话 tmux new -s myname  # 连接会话 tmux a -t myname 硬盘  https://github.com/bootandy/dust  du[5] du -sh /a/* | sort -rh | head -5 jq 过滤[6] select(.name == \u0026quot;TAG\u0026quot;) Print strings without quotes[7] jq --raw-output CPU cat /proc/cpuinfo 参考文献 [1] GARTHWAITE D. [EB/OL](2014–05–01). https://unix.stackexchange.com/a/127355.\n [2] ASKUBUNTU. How to use \"grep\" command to find text including subdirectories[EB/OL](2011–08–01). https://askubuntu.com/questions/55325/how-to-use-grep-command-to-find-text-including-subdirectories.\n [3] STACKOVERFLOW. cURL: How to display progress information while uploading?[EB/OL](2012–04–02). https://stackoverflow.com/questions/9973056/curl-how-to-display-progress-information-while-uploading/41860083.\n [4] STACKOVERFLOW. How to urlencode data for curl command?[EB/OL](2017–08–14). https://stackoverflow.com/questions/296536/how-to-urlencode-data-for-curl-command.\n [5] KUMAR S. How to Find Out Top Directories and Files (Disk Space) in Linux[EB/OL](2016–01–16). https://www.tecmint.com/find-top-large-directories-and-files-sizes-in-linux/.\n [6] STEDOLAN. Cookbook[EB/OL](2019–10–05). https://github.com/stedolan/jq/wiki/Cookbook.\n [7] GITHUB. Print strings without quotes[EB/OL](2013–12–20). https://github.com/stedolan/jq/issues/250.\n  目录  手册  tldr  rsync  带进度条的复制 指定私钥文件[1]  查找字符串  ripgrep grep[2]  网络  curl  上传时显示进度条[3] urlencode 参数[4]   终端  tmux  硬盘  du[5]  jq  过滤[6] Print strings without quotes[7]  CPU 参考文献   "});index.add({'id':9,'href':'/notes/docs/program/python/','title':"Python",'content':"内建函数[1] 字典[2] 遍历 \u0026gt;\u0026gt;\u0026gt; knights = {\u0026#39;gallahad\u0026#39;: \u0026#39;the pure\u0026#39;, \u0026#39;robin\u0026#39;: \u0026#39;the brave\u0026#39;} \u0026gt;\u0026gt;\u0026gt; for k, v in knights.items(): ... print(k, v) ... gallahad the pure robin the brave 键是否存在[3] d = {\u0026quot;key1\u0026quot;: 10, \u0026quot;key2\u0026quot;: 23}  if \u0026quot;key1\u0026quot; in d:  print(\u0026quot;this will execute\u0026quot;)  if \u0026quot;nonexistent key\u0026quot; in d:  print(\u0026quot;this will not\u0026quot;) 合并字典[4] z = {**x, **y} += x += y # x = x + y open 表 1: 打开文件模式说明[5]    mode-string truncate? create? what’s allowed    r no no reading (only)  w yes yes writing (only)  a no yes writing (only), auto-appends  r+ no no read and write  w+ yes yes read and write  a+ no yes read and (auto-appending) write     property 定义属性，默认只读。\nclass Parrot:  def __init__(self):  self._voltage = 100000   @property  def voltage(self):  \u0026quot;\u0026quot;\u0026quot;Get the current voltage.\u0026quot;\u0026quot;\u0026quot;  return self._voltage classmethod 带 cls 的类方法。\nclass C:  @classmethod  def f(cls, arg1, arg2, ...): ... numpy import numpy as np 右乘列向量 \\[\\matrix{A}\\vec{x}\\qquad(1)\\]\nnp.dot(A, x) 范数[6] \\[\\lVert\\vec{x}\\rVert_2 = \\left(\\sum_i \\lvert x_i\\rvert^2\\right)^{\\frac{1}{2}}\\qquad(2)\\]\n\u0026gt;\u0026gt;\u0026gt; np.linalg.norm([3, 4]) 5.0 奇异值分解 \\[\\matrix{A} = \\matrix{U}\\matrix{D}\\transpose{\\matrix{V}}\\qquad(3)\\]\nU, d, Vt = np.linalg.svd(A) # U @ np.diag(d) @ Vt == A 常用函数 def upper_first_char(str):  return \u0026#39;{}{}\u0026#39;.format(str[0].upper(), str[1:]) 参考文献 [1] PYTHON.ORG. Built-in Functions[EB/OL]([日期不详]). https://docs.python.org/3/library/functions.html#built-in-functions.\n [2] PYTHON.ORG. Looping Techniques[EB/OL]([日期不详]). https://docs.python.org/3/tutorial/datastructures.html#looping-techniques.\n [3] B. C. Check if a given key already exists in a dictionary[EB/OL](2009–10–21). https://stackoverflow.com/a/1602964.\n [4] HALL A. How do I merge two dictionaries in a single expression?[EB/OL](2011–11–10). https://stackoverflow.com/a/26853961.\n [5] TOREK. Open file for reading and writing with truncate[EB/OL](2015–11–01). https://stackoverflow.com/a/33466886.\n [6] SCIPY.ORG. numpy.linalg.norm[EB/OL]([日期不详]). https://docs.scipy.org/doc/numpy/reference/generated/numpy.linalg.norm.html.\n  目录  内建函数[1]  字典[2]  遍历 键是否存在[3] 合并字典[4]  += open property classmethod  numpy  右乘列向量 范数[6] 奇异值分解  常用函数 参考文献   "});index.add({'id':10,'href':'/notes/tags/','title':"Tags",'content':""});index.add({'id':11,'href':'/notes/docs/program/tex/','title':"TeX",'content':"运算符 表 1: 运算符    运算符 含义 \\(\\TeX\\) 表示    \\(\\langle, \\rangle\\) 内积 \\langle, \\rangle  \\(\\otimes\\) 外积 \\otimes     数学表达式 表 2: 数学表达式    数学表达式 含义 \\(\\TeX\\) 表示    \\(\\{n \\mid 0 \\le n \\le 19\\}\\) 集合 \\{n \\mid 0 \\le n \\le 19\\}  \\(\\bar{p}\\) 平均值 \\bar{p}  \\(\\set{R}\\) 实数集 \\set{R}     公式对齐[1] \\begin{align} 2x - 5y \u0026amp;= 8 \\\\ 3x + 9y \u0026amp;= -12 \\end{align}  align* 表示不编号[2]。\n 参考文献 [1] OVERLEAF. Aligning equations with amsmath[EB/OL]([日期不详]). https://www.overleaf.com/learn/latex/Aligning_equations_with_amsmath.\n [2] KOTTWITZ S. What’s the difference between align and align*?[EB/OL](2011–01–23). https://tex.stackexchange.com/a/9515.\n  目录  运算符 数学表达式 公式对齐[1] 参考文献   "});index.add({'id':12,'href':'/notes/docs/program/toml/','title':"Toml",'content':"Table[1] [table] 参考文献 [1] TOML. TOML[EB/OL]([日期不详]). https://github.com/toml-lang/toml.\n  目录  Table[1] 参考文献   "});index.add({'id':13,'href':'/notes/docs/visual/unity/','title':"Unity",'content':"导入 .obj 文件时 x 轴会取反[1] 参考文献 [1] STACKOVERFLOW. Unity flips x coordinate in obj using importer at runtime[EB/OL](2018–08–27). https://stackoverflow.com/a/52044185.\n  目录  导入 .obj 文件时 x 轴会取反[1] 参考文献   "});index.add({'id':14,'href':'/notes/docs/tools/writing/','title':"写作",'content':"Pandoc pandoc --print-default-template=html 静态网站生成器 静态网站生成器列表：https://www.staticgen.com/。\nHugo 常用命令 # 查看程序版本 hugo version  # 创建网站 hugo new site quickstart  # 添加主题 git submodule add https://github.com/ribice/kiss.git themes/kiss  # 添加内容 hugo new posts/my-first-post.md 主题  文档：https://github.com/alex-shpak/hugo-book 博客：https://github.com/ribice/kiss  部署到 GitHub Pages 请参考 https://github.com/peaceiris/actions-gh-pages#getting-started。\nMathJax \u0026lt;script\u0026gt; MathJax = {  tex: {  inlineMath: [[\u0026#39;$\u0026#39;, \u0026#39;$\u0026#39;], [\u0026#39;\\\\(\u0026#39;, \u0026#39;\\\\)\u0026#39;]]  },  svg: {  fontCache: \u0026#39;global\u0026#39;  } }; \u0026lt;/script\u0026gt; \u0026lt;scripttype=\u0026quot;text/javascript\u0026quot;id=\u0026quot;MathJax-script\u0026quot;async src=\u0026quot;https://cdn.jsdelivr.net/npm/mathjax@3/es5/tex-svg.js\u0026quot;\u0026gt; \u0026lt;/script\u0026gt;  MathJax 对象需要在加载 MathJax 脚本前初始化。\n Citation Style Language Official repository for Citation Style Language (CSL) citation styles: https://github.com/citation-style-language/styles。\n目录  Pandoc 静态网站生成器  Hugo  常用命令 主题  部署到 GitHub Pages MathJax  Citation Style Language   "});index.add({'id':15,'href':'/notes/docs/tools/compress/','title':"压缩",'content':"tar 打包时排除某些目录[1] tar --exclude=\u0026#39;./folder1\u0026#39; --exclude=\u0026#39;./folder2\u0026#39; -czvf filename.tar.gz . 参考文献 [1] STACKOVERFLOW. Shell command to tar directory excluding certain files/folders[EB/OL](2009–06–11). https://stackoverflow.com/a/984259.\n  目录  tar 打包时排除某些目录[1] 参考文献   "});index.add({'id':16,'href':'/notes/docs/tools/version-control/','title':"版本控制",'content':"Git Git Submodule # 下载 submodule git submodule update --init --force --recursive --depth=1  # 更新 url git submodule set-url themes/book https://github.com/alex-shpak/hugo-book.git 目录  Git  Git Submodule    "});index.add({'id':17,'href':'/notes/docs/math/linear-algebra/','title':"线性代数",'content':"相似矩阵  同一个线性变换在不同基下的矩阵称为相似矩阵  正交矩阵[1] \\[\\transpose{\\matrix{Q}}\\matrix{Q} = \\matrix{Q}\\transpose{\\matrix{Q}} = \\matrix{I}\\qquad(1)\\]\n旋转矩阵[2] 旋转矩阵的集合：\n\\[ \\SO(n) = \\{\\matrix{R} \\in \\set{R}^{n\\times n} \\mid \\matrix{R}\\transpose{\\matrix{R}} = \\matrix{I}, \\det(\\matrix{R}) = 1\\} \\qquad(2)\\]\n外积[3] \\[\\vec{u} \\otimes \\vec{v} = \\vec{u}\\transpose{\\vec{v}}\\qquad(3)\\]\n参考文献 [1] WIKIPEDIA. Orthogonal matrix[EB/OL]([日期不详]). https://en.wikipedia.org/wiki/Orthogonal_matrix.\n [2] 高翔. 视觉 SLAM 十四讲: 从理论到实践[M]. 电子工业出版社, 2017.\n [3] WIKIPEDIA. Outer product[EB/OL]([日期不详]). https://en.wikipedia.org/wiki/Outer_product.\n  目录  相似矩阵 正交矩阵[1] 旋转矩阵[2] 外积[3] 参考文献   "});index.add({'id':18,'href':'/notes/','title':"首页",'content':"笔记列表  数学  线性代数   视觉  Unity   工具  写作 Linux 版本控制 压缩 API   编程  TeX Python Bash TOML Golang JavaScript CSS HTML    "});})();